import React, { useRef, useState } from 'react';
import '../styles/PropertyListings.css';
import { FiMapPin, FiHome, FiLayers, FiDroplet, FiTrendingDown, FiTrendingUp, FiClock, FiChevronLeft, FiChevronRight, FiPlus } from 'react-icons/fi';

const PropertyListings = () => {
  const sliderRef = useRef(null);
  const [showAll, setShowAll] = useState(false);
  const [currentIndex, setCurrentIndex] = useState(0);

  const properties = [
    // ... (same properties array as before)
  ];

  const displayedProperties = showAll ? properties : properties.slice(0, 4);

  const scrollTo = (direction) => {
    const container = sliderRef.current;
    const cardWidth = container.firstChild?.offsetWidth || 350;
    const gap = 32; // 2rem in pixels
    const scrollAmount = (cardWidth + gap) * direction;
    
    container.scrollBy({
      left: scrollAmount,
      behavior: 'smooth'
    });

    // Update current index (simplified logic)
    const newIndex = Math.max(0, Math.min(currentIndex + direction, properties.length - 1));
    setCurrentIndex(newIndex);
  };

  const handleViewMore = () => {
    setShowAll(true);
    // Scroll to top of component if needed
    setTimeout(() => {
      sliderRef.current?.scrollTo({ left: 0, behavior: 'smooth' });
    }, 100);
  };

  return (
    <section className="property-listings">
      <div className="listings-header">
        <h2 className="listings-title">Homes For You in Boston, MA</h2>
        <p className="listings-subtitle">Based on homes you recently viewed</p>
      </div>
      
      <div className="listings-container">
        <div className="navigation-arrows">
          <button 
            className="arrow-btn"
            onClick={() => scrollTo(-1)}
            disabled={currentIndex === 0}
            aria-label="Previous properties"
          >
            <FiChevronLeft size={24} />
          </button>
          <button 
            className="arrow-btn"
            onClick={() => scrollTo(1)}
            disabled={currentIndex >= properties.length - (showAll ? 0 : 1)}
            aria-label="Next properties"
          >
            <FiChevronRight size={24} />
          </button>
        </div>
        
        <div className="properties-slider" ref={sliderRef}>
          {(showAll ? properties : properties.slice(0, 4)).map(property => (
            <div key={property.id} className="property-card">
              <img 
                src={property.image} 
                alt={property.address} 
                className="property-image"
              />
              <div className="property-badge">{property.status}</div>
              
              <div className="property-details">
                {property.daysOnMarket > 0 && (
                  <span className="days-on-market">
                    <FiClock /> {property.daysOnMarket} days on market
                  </span>
                )}
                
                {property.priceChange && (
                  <div className={`price-change ${property.priceChange.direction}`}>
                    {property.priceChange.direction === 'down' ? (
                      <FiTrendingDown />
                    ) : (
                      <FiTrendingUp />
                    )}
                    Price {property.priceChange.direction === 'down' ? 'cut' : 'increase'}: {property.priceChange.amount} ({property.priceChange.date})
                  </div>
                )}
                
                <div className="property-price">{property.price}</div>
                <div className="property-address">
                  <FiMapPin /> {property.address}
                </div>
                
                <div className="property-meta">
                  <span><FiHome /> {property.beds} bds</span>
                  <span><FiDroplet /> {property.baths} ba</span>
                  <span><FiLayers /> {property.sqft.toLocaleString()} sqft</span>
                </div>
                
                <div className="property-agent">
                  {property.mlsId}, {property.agent}
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
      
      {!showAll && (
        <div className="view-more-container">
          <button className="view-more-btn" onClick={handleViewMore}>
            <FiPlus /> View More Properties
          </button>
        </div>
      )}
    </section>
  );
};

export default PropertyListings;
